pragma solidity >=0.4.21 <0.6.0;
pragma experimental ABIEncoderV2;

import "./libToken.sol";

/**
 * The tokenCreation contract does this and that...
 */
contract TokenCreation {
    // using Token for libToken.Token;
	libToken newToken;
	struct TokenData {
		libToken token;
	}
	mapping (uint => TokenData) public tokens;


	function createToken (uint _id, string memory _symbol, string memory _name, uint256 _supply, uint8 _rate, string memory _currency) public returns(TokenData memory token) {
		newToken = new libToken(_symbol, _name, _supply, _rate, _currency);// This instantiation returns an address of the newly created contract
		tokens[_id] = TokenData(newToken);
		return tokens[_id];
	}

	function otherStuff (uint _id) view public returns (uint256) {
	   TokenData storage _token = tokens[_id];
	   ERC20Interface ERCToken = ERC20Interface(_token.token);
	   return ERCToken.totalSupply();
	}

	function getDetail (uint _id) view public returns (string memory, string memory, uint8, uint256, uint8, string memory, address){
	   TokenData storage _token = tokens[_id];
	   ERC20Interface ERCToken = ERC20Interface(_token.token);
	   return ERCToken.details();
	}

}
